import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import PostForm from '../components/PostForm'
import PostCard from '../components/PostCard'
import { LOG_IN } from '../reducers/user'

const dummy = {
    isLoggedIn: true,
    imagePaths: [],
    mainPosts: [{
        User: {
            id: 1,
            nickname: '제로초',
        },
        content: '첫 번째 게시글',
        img: 'http://suksas.dothome.co.kr/data/file/gallery/3673136287_hxvzTgGf_8243a752ff9c28838e5609aec6894ebfc66df151.jpg'
    }]
}

// rafce
const Home = () => {
    const dispatch = useDispatch()
    const { isLoggedIn, user } = useSelector(state => state.user)

    useEffect(() => {
        dispatch({
            type: LOG_IN,
            data: {
                nickname: '석사'
            }
        })
    }, [])

    return (
        <>
            {user ? '로그인됨 '+user.nickname : '로그아웃'}
            {dummy.isLoggedIn && <PostForm />}
            {dummy.mainPosts.map(c => <PostCard key={c} post={c} />)}
        </>
    )
}

export default Home
